import React, { useState } from 'react';
import AddIcon from '@material-ui/icons/Add';
const App = () =>{
     let [count, setCount] = useState(0);
     const IncData = ()=>{
         setCount(count + 1);
     }

     const DecData = () =>{
         if(count > 0){
            setCount(count - 1);
         }else{
             setCount(0);
             alert('Nagitive value is not Allow');
         }
         
     }
    return (
        <>
          <div className='main_div'>
              <div className='center_div'>
                  <h1>{count}</h1>
                  <div className='btn_div'>
                      <button onClick={IncData}><AddIcon /></button>
                      <button onClick={DecData}>Decrem</button>
                  </div>
              </div>
          </div>
        </>
    )
}

export default App;
